:text: |
  Descendants of WILLIAMS, Henry and COLDHAM, Marianne
  JWILLIAMS, Marianne and DAVIES, Christopher Pearson
  V DAVIES, George Henry and GODFREY, Rose Alma
  JDAVIES, Christopher ap Rhys and HAWKES, Lilian Margaret
  JDAVIES, Margaret Dorothy and BRAMLEY, Frank William (Bill)
  JBRAMLEY, Susan Margaret and van der VLOODT, Frederik Hendrik
  01> BRAMLEY, Susan Margaret m on 23.01.1988 to van der VLOODT, Frederik
  Hendrik
  b 28.05.1960
  b 23.07.1958
  Susan b. at Taihape and m, at Taumarunui. Frederik, slo Hendrik van der
  Vloodt and Margreta Helena Clara Meijering, b. at Greytown. Hendrik and
  Margreta were born in the East Indies.
  Susan was educated at Kirikau Primary School, Nga Tawa School, Marton and
  Victoria University. She received a Duke of Edinburgh Gold Award in 1977
  and graduated with a BA in History in 1980. She worked as a library
  assistant at the Geophysics Division of the DSIR from 1981-84, and then at the Correspondence
  School Library from 1984-85. She received the New Zealand Library Studies Certificate in 1985.
  After time off for travelling overseas, she then worked at the Ministry of Works and Development
  Central Library (later Technical Library and Information Service (TELIS), Works Consultancy
  Services) as a cataloguer (1986-88), Buildata Librarian (1988-91) and Reference Librarian
  (1991-93). She is now working at home caring for Catie and Sophie as well as doing some voluntary
  work. She is interested in family history, gardening and reading.
  Frederik was educated at Kuranui College (Greytown) and the University of Auckland. He graduated
  MA(Hons) in History and Political Science in 1981. He then lived in the Netherlands and
  subsequently worked for the Department of Health. Since 1984 he has worked for the Ministry of
  Foreign Affairs and Trade where he is now a development programme manager. His interests include
  history and various sports.
  01> van der VLOODT, Catharina Margaret Johanna
  b 05.10.1993
  Catharina (Catie) b. at Wellington. She attends Karori Kindergarten and is an enthusiastic
  singer and dancer.
  02> van der VLOODT, Sophie Ealand
  b 24.08.1996
  Sophie b. at Wellington.
  02> BRAMLEY, Peter Rhys Ealand m on 10.01.1987 to BAKER, Marie Noelene
  b 07.11.1961
  b 19.09.1964
  Peter b. at Taihape and m, at Te Awamutu. Marie, d/o Arnold Baker and
  Colleen Sheridan. Lairdvale, RD 4, Taumarunui.
  Peter was educated at Kirikau Primary School, St George's, Wanganui,
  Palmerston North Boys' High School and Massey University. He obtained a
  Diploma in Agriculture then attended an Outward Bound Course at Anakiwa.
  He is a Past Chairman of the Taumarunui Young Farmers' Club and his other
  interests include canoeing, tramping, badminton and rugby. He is currently farming at Taumarunui,
  Central King Country.
  Marie obtained a Diploma in Teaching from Hamilton Teachers' College and has taught at Piopio and
  Taringamotu. She is an accomplished pianist (ATCL) and needleworker and interested in handcrafts,
  table tennis, badminton and gardening. She is also doing part-time teaching.
  Refer to "The Libeau Family of Banks Peninsula" published by Evagean Publishing in 1995 for records
  of Marie's family.
  01> BRAMLEY, Hannah May
  b 09.04.1989
  Hannah b. at Taumarunui.
